import './App.css';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Room from './pages/Room';
import Home from './pages/Home';


function App() {
  return (
    <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/room/:id" element={<Room/>}/>
        </Routes>
    </BrowserRouter>

  );
}

export default App;
